import React from 'react'

import './Tabs.css'
 
export default function TabComponent(props) {
  
    return (
      <div className="TabComponent">
        <div className="Tabs">
        <div className="tab" onClick={()=>props.ActiveTab("tab1")}></div>   
     <div className="tab" onClick={()=>ActiveTab("tab2")}></div>
        </div>
   
  </div>
    )
}
